CREATE TABLE IF NOT EXISTS `wp_woocommerce_attribute_taxonomies` (  `attribute_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,  `attribute_name` varchar(200) NOT NULL,  `attribute_label` varchar(200) DEFAULT NULL,  `attribute_type` varchar(20) NOT NULL,  `attribute_orderby` varchar(20) NOT NULL,  `attribute_public` int(1) NOT NULL DEFAULT 1,  `attribute_size` varchar(20) NOT NULL DEFAULT '20x20',  PRIMARY KEY (`attribute_id`),  KEY `attribute_name` (`attribute_name`(20))) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci;
DROP TABLE IF EXISTS `wp_woocommerce_downloadable_product_permissions`;
CREATE TABLE IF NOT EXISTS `wp_woocommerce_downloadable_product_permissions` (  `permission_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,  `download_id` varchar(36) NOT NULL,  `product_id` bigint(20) unsigned NOT NULL,  `order_id` bigint(20) unsigned NOT NULL DEFAULT 0,  `order_key` varchar(200) NOT NULL,  `user_email` varchar(200) NOT NULL,  `user_id` bigint(20) unsigned DEFAULT NULL,  `downloads_remaining` varchar(9) DEFAULT NULL,  `access_granted` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',  `access_expires` datetime DEFAULT NULL,  `download_count` bigint(20) unsigned NOT NULL DEFAULT 0,  PRIMARY KEY (`permission_id`),  KEY `download_order_key_product` (`product_id`,`order_id`,`order_key`(16),`download_id`),  KEY `download_order_product` (`download_id`,`order_id`,`product_id`),  KEY `order_id` (`order_id`),  KEY `user_order_remaining_expires` (`user_id`,`order_id`,`downloads_remaining`,`access_expires`)) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci;
DROP TABLE IF EXISTS `wp_woocommerce_log`;
CREATE TABLE IF NOT EXISTS `wp_woocommerce_log` (  `log_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,  `timestamp` datetime NOT NULL,  `level` smallint(4) NOT NULL,  `source` varchar(200) NOT NULL,  `message` longtext NOT NULL,  `context` longtext DEFAULT NULL,  PRIMARY KEY (`log_id`),  KEY `level` (`level`)) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci;
DROP TABLE IF EXISTS `wp_woocommerce_order_itemmeta`;
CREATE TABLE IF NOT EXISTS `wp_woocommerce_order_itemmeta` (  `meta_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,  `order_item_id` bigint(20) unsigned NOT NULL,  `meta_key` varchar(255) DEFAULT NULL,  `meta_value` longtext DEFAULT NULL,  PRIMARY KEY (`meta_id`),  KEY `order_item_id` (`order_item_id`),  KEY `meta_key` (`meta_key`(32))) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci;
DROP TABLE IF EXISTS `wp_woocommerce_order_items`;
CREATE TABLE IF NOT EXISTS `wp_woocommerce_order_items` (  `order_item_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,  `order_item_name` text NOT NULL,  `order_item_type` varchar(200) NOT NULL DEFAULT '',  `order_id` bigint(20) unsigned NOT NULL,  PRIMARY KEY (`order_item_id`),  KEY `order_id` (`order_id`)) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci;
DROP TABLE IF EXISTS `wp_woocommerce_payment_tokenmeta`;
CREATE TABLE IF NOT EXISTS `wp_woocommerce_payment_tokenmeta` (  `meta_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,  `payment_token_id` bigint(20) unsigned NOT NULL,  `meta_key` varchar(255) DEFAULT NULL,  `meta_value` longtext DEFAULT NULL,  PRIMARY KEY (`meta_id`),  KEY `payment_token_id` (`payment_token_id`),  KEY `meta_key` (`meta_key`(32))) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci;
DROP TABLE IF EXISTS `wp_woocommerce_payment_tokens`;
CREATE TABLE IF NOT EXISTS `wp_woocommerce_payment_tokens` (  `token_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,  `gateway_id` varchar(200) NOT NULL,  `token` text NOT NULL,  `user_id` bigint(20) unsigned NOT NULL DEFAULT 0,  `type` varchar(200) NOT NULL,  `is_default` tinyint(1) NOT NULL DEFAULT 0,  PRIMARY KEY (`token_id`),  KEY `user_id` (`user_id`)) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci;
DROP TABLE IF EXISTS `wp_woocommerce_sessions`;
CREATE TABLE IF NOT EXISTS `wp_woocommerce_sessions` (  `session_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,  `session_key` char(32) NOT NULL,  `session_value` longtext NOT NULL,  `session_expiry` bigint(20) unsigned NOT NULL,  PRIMARY KEY (`session_id`),  UNIQUE KEY `session_key` (`session_key`)) ENGINE=MyISAM AUTO_INCREMENT=8430 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci;
DROP TABLE IF EXISTS `wp_woocommerce_shipping_zone_locations`;
CREATE TABLE IF NOT EXISTS `wp_woocommerce_shipping_zone_locations` (  `location_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,  `zone_id` bigint(20) unsigned NOT NULL,  `location_code` varchar(200) NOT NULL,  `location_type` varchar(40) NOT NULL,  PRIMARY KEY (`location_id`),  KEY `location_id` (`location_id`),  KEY `location_type_code` (`location_type`(10),`location_code`(20))) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci;
DROP TABLE IF EXISTS `wp_woocommerce_shipping_zone_methods`;
CREATE TABLE IF NOT EXISTS `wp_woocommerce_shipping_zone_methods` (  `zone_id` bigint(20) unsigned NOT NULL,  `instance_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,  `method_id` varchar(200) NOT NULL,  `method_order` bigint(20) unsigned NOT NULL,  `is_enabled` tinyint(1) NOT NULL DEFAULT 1,  PRIMARY KEY (`instance_id`)) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci;
DROP TABLE IF EXISTS `wp_woocommerce_shipping_zones`;
CREATE TABLE IF NOT EXISTS `wp_woocommerce_shipping_zones` (  `zone_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,  `zone_name` varchar(200) NOT NULL,  `zone_order` bigint(20) unsigned NOT NULL,  PRIMARY KEY (`zone_id`)) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci;
DROP TABLE IF EXISTS `wp_woocommerce_tax_rate_locations`;
CREATE TABLE IF NOT EXISTS `wp_woocommerce_tax_rate_locations` (  `location_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,  `location_code` varchar(200) NOT NULL,  `tax_rate_id` bigint(20) unsigned NOT NULL,  `location_type` varchar(40) NOT NULL,  PRIMARY KEY (`location_id`),  KEY `tax_rate_id` (`tax_rate_id`),  KEY `location_type_code` (`location_type`(10),`location_code`(20))) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci;
DROP TABLE IF EXISTS `wp_woocommerce_tax_rates`;
CREATE TABLE IF NOT EXISTS `wp_woocommerce_tax_rates` (  `tax_rate_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,  `tax_rate_country` varchar(2) NOT NULL DEFAULT '',  `tax_rate_state` varchar(200) NOT NULL DEFAULT '',  `tax_rate` varchar(8) NOT NULL DEFAULT '',  `tax_rate_name` varchar(200) NOT NULL DEFAULT '',  `tax_rate_priority` bigint(20) unsigned NOT NULL,  `tax_rate_compound` int(1) NOT NULL DEFAULT 0,  `tax_rate_shipping` int(1) NOT NULL DEFAULT 1,  `tax_rate_order` bigint(20) unsigned NOT NULL,  `tax_rate_class` varchar(200) NOT NULL DEFAULT '',  PRIMARY KEY (`tax_rate_id`),  KEY `tax_rate_country` (`tax_rate_country`),  KEY `tax_rate_state` (`tax_rate_state`(2)),  KEY `tax_rate_class` (`tax_rate_class`(10)),  KEY `tax_rate_priority` (`tax_rate_priority`)) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci;
DROP TABLE IF EXISTS `wp_yith_wcwl`;
CREATE TABLE IF NOT EXISTS `wp_yith_wcwl` (  `ID` bigint(20) NOT NULL AUTO_INCREMENT,  `prod_id` bigint(20) NOT NULL,  `quantity` int(11) NOT NULL,  `user_id` bigint(20) DEFAULT NULL,  `wishlist_id` bigint(20) DEFAULT NULL,  `dateadded` timestamp NOT NULL DEFAULT current_timestamp(),  `position` int(11) DEFAULT 0,  `original_price` decimal(9,3) DEFAULT NULL,  `original_currency` char(3) DEFAULT NULL,  `on_sale` tinyint(4) NOT NULL DEFAULT 0,  PRIMARY KEY (`ID`),  KEY `prod_id` (`prod_id`)) ENGINE=MyISAM AUTO_INCREMENT=13 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;
DROP TABLE IF EXISTS `wp_yith_wcwl_lists`;
CREATE TABLE IF NOT EXISTS `wp_yith_wcwl_lists` (  `ID` bigint(20) NOT NULL AUTO_INCREMENT,  `user_id` bigint(20) DEFAULT NULL,  `wishlist_slug` varchar(200) NOT NULL,  `wishlist_name` text DEFAULT NULL,  `wishlist_token` varchar(64) NOT NULL,  `wishlist_privacy` tinyint(1) NOT NULL DEFAULT 0,  `is_default` tinyint(1) NOT NULL DEFAULT 0,  `dateadded` timestamp NOT NULL DEFAULT current_timestamp(),  `session_id` varchar(255) DEFAULT NULL,  `expiration` timestamp NULL DEFAULT NULL,  PRIMARY KEY (`ID`),  UNIQUE KEY `wishlist_token` (`wishlist_token`),  UNIQUE KEY `wishlist_token_2` (`wishlist_token`),  KEY `wishlist_slug` (`wishlist_slug`)) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;
